import React, {Component} from 'react'
import './App.css';
import peopleInfo from './component/peopleInfo'



class App extends Component{
  constructor(){
    super()
    this.state= {
      info:peopleInfo,
      count: 0

    }
  }
  render() {
    return (
      <body>
        <div className='App'>
          <h1>{peopleInfo[0].name.lastName}, {peopleInfo[0].name.firstName} {peopleInfo[0].name.middleInital}</h1>
          <h2>Born in: {peopleInfo[0].bornIn}</h2>
          <h2>Lives in: {peopleInfo[0].liveIn}</h2>
          <h2>Contact Info : {peopleInfo[0].contacts.phoneNumber} {peopleInfo[0].contacts.email}</h2>
          <h2>Born in: {peopleInfo[0].bornIn}</h2>

        </div>
      </body>
    )
  }
}

export default App;
